import ComA from "./ComA";
const FirstName=createContext();
const LastName=createContext();

const App=()=>{
 
return (
<>
<FirstName.Provider value={"PRITAM Kumar"}>
<LastName.Provider value={"sarangi"}>
<ComA />
</LastName.Provider>
</FirstName.Provider>
</>
);
};
export default App;
export { FirstName,LastName };
